def get_median(arr, l):
    """

    :param arr:
    :param l:
    :return: index of median
    """
    if l < 2:
        return 0
    if l % 2 == 0:
        return int(l / 2)
    else:
        return int((l - 1) / 2)


def split(arr):
    l = len(arr)
    if l <= 1:
        return arr
    else:
        # Select the median as pivot element
        mid = l // 2
        pivot = arr[mid]

        left = []
        right = []
        for i in range(l):
            if i != mid:
                if arr[i] < pivot:
                    left.append(arr[i])
                else:
                    right.append(arr[i])

    return split(left) + [pivot] + split(right)

def insertion_sort(arr):
    for i in range(1, len(arr)):
        j = i
        while j > 0 and arr[j-1] > arr[j]:
            arr[j-1], arr[j] = arr[j], arr[j-1]
            j -= 1
    return arr


def quick_sort(arr):
    if len(arr) <= 10:
        return insertion_sort(arr)
    else:
        pivot = arr[0]
        left = []
        right = []
        for i in range(1, len(arr)):
            if arr[i] < pivot:
                left.append(arr[i])
            else:
                right.append(arr[i])
        return quick_sort(left) + [pivot] + quick_sort(right)


